
CREATE TABLE IF NOT EXISTS `users` (
  `id` int(11) NOT NULL,
  `nombres` varchar(100) CHARACTER SET utf8 NOT NULL,
  `apellidos` varchar(100) COLLATE utf8mb4_spanish_ci NOT NULL,
  `sexo` varchar(100) COLLATE utf8mb4_spanish_ci NOT NULL,
  `tipodocumento` varchar(30) COLLATE utf8mb4_spanish_ci NOT NULL,
  `documento` varchar(30) COLLATE utf8mb4_spanish_ci NOT NULL,
  `fechaNacimiento` date NOT NULL,
  `telefono` varchar(12) COLLATE utf8mb4_spanish_ci NOT NULL,
  `tipoPoblacion` varchar(200) COLLATE utf8mb4_spanish_ci NOT NULL,
  `centro` varchar(100) COLLATE utf8mb4_spanish_ci DEFAULT NULL,
  `municipio` varchar(100) COLLATE utf8mb4_spanish_ci NOT NULL,
  `email` varchar(100) COLLATE utf8mb4_spanish_ci NOT NULL,
  `password` varchar(500) COLLATE utf8mb4_spanish_ci NOT NULL,
  `rol` varchar(200) COLLATE utf8mb4_spanish_ci NOT NULL DEFAULT 'Administrador',
  `fechaRegistro` date NOT NULL,
  `fecha_sesion` date DEFAULT NULL,
  `img` varchar(500) COLLATE utf8mb4_spanish_ci NOT NULL DEFAULT 'default-user-img.jpg',
  `tipo_archivo` varchar(100) COLLATE utf8mb4_spanish_ci NOT NULL DEFAULT 'image/jpg'
) ENGINE=InnoDB AUTO_INCREMENT=10101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_spanish_ci;

